import React, {Component} from 'react';
import {Card, CardImg, Container} from "react-bootstrap";
import CardHeader from "react-bootstrap/CardHeader";
import img1 from "../assets/2bfb01b0a891c3d4d5e6a33a9b5b679f1dd7aef0ab89c4293412df567a97c9cf.jpeg";


class Contacts extends Component {
    render() {
        return (
            <div>
                <Container>
                    <CardGroup>
                        <Card className={"m-4"}>
                            <CardHeader>
                                <CardImg variant={"top"}
                                         src={img1}
                                />
                            </CardHeader>
                        </Card>
                        <Card className={"m-4"}>
                            <CardHeader>
                                <CardImg variant={"top"}
                                         src={img1}
                                />
                            </CardHeader>
                        </Card>
                    </CardGroup>
                </Container>
            </div>
        );
    }
}

export default Contacts;
